const NavLink = (props) => {
    return <a>{props.navlink}</a>
}

const Navbar = () => {

    const navlinks = ['Contact','Projects','Experience','About','Home']

    return (
        <div>
            <p>MyFolio</p>
            <NavLink navlink={navlinks.map()}/>
        </div>
    );
}

export default Navbar;
